import { createSlice } from '@reduxjs/toolkit';
    const initialState = {
     image:"data:image/png;base64,",
     description:"Passionate software engineering student at Bahria University, proficient in HTML, CSS, Bootstrap, Tailwind CSS, JavaScript, ReactJS, NodeJS, Asp.net, C#, Java, MongoDB, and SQL. I aim to use my expertise to contribute effectively in a professionalsetting.",
     cv:'./src/assets/my cv.pdf',
     
    };
    
    const homeSlice = createSlice({
      name: 'home',
      initialState,
      reducers: {
         downloadcv : (state,action) => {
     
          fetch(state.cv).then((response) => {
              response.blob().then((blob) => {
               
                  const fileURL =
                      window.URL.createObjectURL(blob);
                       
                  let alink = document.createElement("a");
                  alink.href = fileURL;
                  alink.download = "basil's CV.pdf";
                  alink.click();
              });
          });
      },
    
           setImage:(state,action)=>{
            state.image= action.payload;
        },
           setDescription:(state,action)=>{
            state.description= action.payload;
        },
      },
    });
    
    export const {setImage,downloadcv,setDescription} = homeSlice.actions;
    export default homeSlice.reducer;
    